import React, { Component } from 'react';
import { Radar } from 'react-chartjs-2';

const data = {
    labels: [
      "Eating",
      "Drinking",
      "Sleeping",
      "Designing",
      "Coding",
      "Cycling",
      "Running"
    ],
    datasets: [
      {
        label: "My First dataset",
        backgroundColor: "rgba(220,220,220,0.2)",
        pointBackgroundColor: "rgba(220,220,220,1)",
        data: [
          10,
          20,
          30,
          40,
          50,
          60,
          70
        ]
      }
    ]
  }
  
  const options = {
    legend: {
      position: 'top'
    },
    title: {
      display: true,
      text: 'Statistics'
    },
    scale: {
      reverse: false,
      ticks: {
        beginAtZero: true
      },
      pointLabels: {
          fontSize: 20,
          pointRadius: 50
      }
    }
  }

export default class Prova extends Component {

    render() {
        return (
            <Radar data={data} options={options} />
        )
    }
}
